import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { IArticulo } from 'src/app/interfaces/articulo.interface';
import { Articulo } from 'src/app/model/articulo.model';
import { ArticuloService } from 'src/app/services/articulo.service';
import { AlertasComponent } from '../../alertas/alertas.component';
import { ITable, PdfMakeWrapper, Table, TocItem } from 'pdfmake-wrapper';

import { Console } from 'node:console';
import { SettingsService } from 'src/app/services/settings.service';
import { IEmpresa } from 'src/app/interfaces/empresa.interface';
import { Empresa } from 'src/app/model/empresa.model';
import * as pdfMake from 'pdfmake/build/pdfmake';
import { IListaPrecio } from 'src/app/interfaces/listaprecio.interface';
import { ListaPrecio } from 'src/app/model/listaprecio.model';
import { ListaPrecioService } from 'src/app/services/listaprecio.service';

@Component({
  selector: 'app-listaprecios',
  templateUrl: './reporte-lista-precios.component.html',
  styleUrls: ['./reporte-lista-precios.component.css'],
})
export class ReporteListaPreciosComponent implements OnInit {
  listaArticulo: IArticulo[] = [];
  listaArticulosAll: IArticulo[] = [];
  listaListaPrecio: IListaPrecio[] = [];

  filtroBusquedaNombre: String;
  filtroBusquedaCode: String;

  page: number = 1;
  itemsPage: number = 5;
  totalItems: number = 10;
  cantidadItems: number = 0;
  objetoArticulo: IArticulo = new Articulo();
  objetoEmpresa: IEmpresa = new Empresa();
  objetoListaPrecio: IListaPrecio = new ListaPrecio();
  ListaActual: string;
  pdf = new PdfMakeWrapper();

  constructor(
    private serviceSettings: SettingsService,
    private router: Router,
    private alertasComponent: AlertasComponent,
    private articuloService: ArticuloService,
    private serviceListaPrecio: ListaPrecioService
  ) {}

  ngOnInit(): void {
    this.listarArticulos();
    this.listarArticulosAll();
    this.buscarDatosEmpresa();
    this.buscarListasDePrecio();
  }

  generateListaPrecio(action: String) {
    let date = new Date();
    let today = date.toLocaleDateString();

    if (this.objetoListaPrecio.name == null) {
      this.objetoListaPrecio.name = '';
    }
    let docDefinition = {
      content: [
        {
          columns: [
            {
              text: 'LISTA DE PRECIOS' + '\n' + this.objetoListaPrecio.name,
              fontSize: 18,
            },

            {
              image:
                'data:image/jpeg;base64,',

              width: 180,
              height: 50,
            },
            {
              text:
                this.objetoEmpresa.businessName +
                '\n' +
                'Fecha Impresion: ' +
                today.toString() +
                '\n' +
                this.objetoEmpresa.email +
                '\n',
              fontSize: 10,
            },
          ],
        },
        {
          style: { fontSize: 8 },
          table: {
            headerRows: 1,
            widths: [80, 250, 80, 80],
            body: [
              ['Codigo', 'Nombre', 'Marca', 'Precio Venta'],
              [
                this.listaArticulosAll.map((art) => [art.code]),
                this.listaArticulosAll.map((art) => [art.name]),
                this.listaArticulosAll.map((art) => [art.brand.name]),
                this.listaArticulosAll.map((art) => [
                  art.salePriceWithAliquot.toFixed(2),
                ]),
              ],
            ],
          },
        },
      ],
      styles: {
        header: {
          fontSize: 18,
          bold: true,
        },
        subheader: {
          fontSize: 15,
          bold: true,
        },
        quote: {
          italics: true,
        },
        small: {
          fontSize: 8,
        },
      },
    };

    if (action == 'download') {
      pdfMake.createPdf(docDefinition).download();
    } else if (action == 'print') {
      pdfMake.createPdf(docDefinition).print();
    } else if (action == 'open') {
      pdfMake.createPdf(docDefinition).open();
    }
  }

  listarArticulosListaReporte() {
    this.listarArticulos();
    this.listarArticulosAll();
  }

  listarArticulos() {
    this.articuloService
      .getArticulosPaginado(
        this.itemsPage,
        this.page,
        this.filtroBusquedaNombre,
        '',
        '',
        '',
        this.filtroBusquedaCode
      )
      .subscribe(
        (respuesta) => {
          this.listaArticulo = respuesta.content;
          this.totalItems = respuesta.meta.totalItems;
        },
        (error) => {
          this.alertasComponent.showOcurrioErrorStrategy(error);
        }
      );
  }

  listarArticulosAll() {
    this.articuloService
      .getArticulosWhere(
        this.filtroBusquedaNombre,
        '',
        '',
        '',
        this.filtroBusquedaCode
      )
      .subscribe(
        (respuesta) => {
          this.listaArticulosAll = respuesta;
        },
        (error) => {
          this.alertasComponent.showOcurrioErrorStrategy(error);
        }
      );
  }

  buscarDatosEmpresa() {
    this.serviceSettings.getDatosEmpresa().subscribe(
      (respuesta) => {
        this.objetoEmpresa = respuesta;
      },
      (error) => {
        this.alertasComponent.showOcurrioErrorStrategy(error);
      }
    );
  }

  buscarListasDePrecio() {
    this.serviceListaPrecio.getListaPrecio().subscribe(
      (respuesta) => {
        this.listaListaPrecio = respuesta;
      },
      (error) => {
        this.alertasComponent.showOcurrioErrorStrategy(error);
      }
    );
  }

  actualizarPrecios() {
    this.objetoListaPrecio.value = Number(
      this.listaListaPrecio.find(
        (precio) => precio.name == this.objetoListaPrecio.name
      )?.value
    );

    var descuento: number;
    var recargo: number;
    var precio: number;
    if (
      this.objetoListaPrecio.name != '' &&
      this.objetoListaPrecio.name != null
    ) {
      for (let item of this.listaArticulo) {
        this.articuloService.getArticuloById(item.id).subscribe(
          (respuesta) => {
            if (this.objetoListaPrecio.value < 0) {
              descuento = (100 - this.objetoListaPrecio.value * -1) / 100;
              precio = Number(
                (respuesta.salePriceWithAliquot * descuento).toFixed(2)
              );
              item.salePriceWithAliquot = precio;
            } else if (this.objetoListaPrecio.value > 0) {
              recargo = 1 + this.objetoListaPrecio.value / 100;
              precio = Number(
                (respuesta.salePriceWithAliquot * recargo).toFixed(2)
              );
              item.salePriceWithAliquot = precio;
            }
          },
          (error) => {
            this.alertasComponent.showOcurrioErrorStrategy(error);
          }
        );
      }
      for (let item of this.listaArticulosAll) {
        this.articuloService.getArticuloById(item.id).subscribe(
          (respuesta) => {
            if (this.objetoListaPrecio.value < 0) {
              descuento = (100 - this.objetoListaPrecio.value * -1) / 100;
              precio = Number(
                (respuesta.salePriceWithAliquot * descuento).toFixed(2)
              );
              item.salePriceWithAliquot = precio;
            } else if (this.objetoListaPrecio.value > 0) {
              recargo = 1 + this.objetoListaPrecio.value / 100;
              precio = Number(
                (respuesta.salePriceWithAliquot * recargo).toFixed(2)
              );
              item.salePriceWithAliquot = precio;
            }
          },
          (error) => {
            this.alertasComponent.showOcurrioErrorStrategy(error);
          }
        );
      }
    } else {
      this.listarArticulos();
      this.listarArticulosAll();
    }
  }
}
